Verenigde Staten
Actie / Avontuur
113 minuten

goed

met Jason Momoa, Rachel Nichols en Ron Perlman

Conan (Momoa) is de laatste van zijn volk. Hij zag zijn vader sterven en is vastbesloten om zijn vader te wreken. Hij zal 
iedereen doden die verantwoordelijk was voor de dood van zijn volk. Maar hij heeft een erg gevaarlijke vijand: de almachtige 
Khalar Sing.
